import React, { useState } from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
const User = (props) => {
    const { name, email, img, yearlyIncome, address } = props.user;
    const { street, suite, city, zipcode } = address;
    return (
        <div className="container-fluid mx-auto">
            <div className="card float-left text-center " style={{ width: '20rem' }}>
                <img className="card-img-top mt-3" style={{ height: '350px' }} src={img} alt="" />
                <div className="card-body">
                    <h4 className="card-title">{name}</h4>
                    <button className="btn btn-primary">Add Friend</button>
                </div>
                <ul className="list-group list-group-flush">
                    <li className="list-group-item">email: {email}</li>
                    <li className="list-group-item">Yearly Income : ${yearlyIncome}</li>
                </ul>
                <p className="card-text"><b> Address:</b> &nbsp;
                    {street},
                    <br />
                    {suite},
                    <br />
                    {city},
                    <br />
                    {zipcode}
                </p>
            </div>
        </div>
    );
};

export default User;
